import {
   IonPage,
   IonContent,
   IonButton,
   IonGrid,
   IonRow,
   IonCol
} from '@ionic/react';

const StartPage: React.FC = () => (
   <IonPage>

      <IonContent>
         <IonGrid>
            <IonRow>
               <IonCol>

                  <IonButton routerLink="/" >Get Started</IonButton>
               </IonCol>
            </IonRow>
         </IonGrid>
      </IonContent>
   </IonPage>
);
export default StartPage;
